import React, { Fragment, useState } from "react";
import "./mainMenu.css";
import RealEstate from "./realEstate/RealEstate";
import Grains from "./grains/Grains";

const MainMenu = (props) => {
  const [currentMenu, setCurrentMenu] = useState('intro');

  const changeToLandsPage = () => {
    setCurrentMenu('lands');
  }

  const changeToGrainsPage = () => {
    setCurrentMenu('grains');
  }

  const changeToMainMenu = () => {
    setCurrentMenu('mainMenu');
  }

  let renderedScreen;
  switch (currentMenu) {
    case 'grains':
      renderedScreen = <Grains changeToMainMenu={changeToMainMenu} />;
      break;
    case 'lands':
      renderedScreen = <RealEstate changeToMainMenu={changeToMainMenu} />;
      break;
    default:
      renderedScreen = <MainMenu changeToMainMenu={changeToMainMenu} />;
  }

  return (
    <Fragment>
      <div className="report">
        {/* todo: Figure out x, y, z */}
        <h3>Big Alien Mafia Gangster Boss</h3>
        <h4>Human Beings ate x% of your food!</h4>
        <h5>y Weather z Harvest</h5>
      </div>
      <div className="stats">
        {/* todo: numbers must be defined */}
        <div className="grains d-stats-flex">
          <span>Grains Reserve</span>
          <span>number</span>
          <span>Bushels</span>
        </div>
        <div className="grain-demand d-stats-flex">
          <span>Grains Demand</span>
          <span>number</span>
          <span>Bushels</span>
        </div>
        <div className="grain-price d-stats-flex">
          <span>Price of Grain</span>
          <span>number1</span>
          <span>number2 st</span>
        </div>
        <div className="land-price d-stats-flex">
          <span>Price Of Land</span>
          <span>number</span>
          <span>Acre</span>
        </div>
        <div className="treasury-gold d-stats-flex">
          <span>Treasury Gold</span>
          <span>number</span>
          <span>Florins</span>
        </div>
      </div>
      <div className="instructions">
        <p>

          <button className='continue-btn' onClick={props.changeToTestPage} >
            Press here to continue
          </button>
          or the buttons below if you wish to buy or Sell grains and lands
        </p>
      </div>
      <div className="options">
        <div className="option-1">
          <button className="option-btn" onClick={changeToGrainsPage}>
            Grain Market
          </button>
        </div>
        <div className="option-2">
          <button className="option-btn" onClick={changeToLandsPage}>
            Land Office
          </button>
        </div>
      </div>
      {renderedScreen}
    </Fragment>
  );
};

export default MainMenu;
